import React from 'react'
import {Images} from '../constants'

const NavBarItems = [
    {name: "Home"},
    {name: "Articles"},
    {name: "Pages"},
    {name: "Pricing"},
    {name: "FAQ"}
]

const NavListItem= ({item}) =>{
    return (
<li className='border border-blue-500 group px-2'>
    <a href="/">{item}</a>
    <span></span>
</li>);
}

const Header = () => {
  return (
   <header className='container flex justify-between items-center p-1 mx-auto'>
    <div className='w-10 h-10'><img src={Images.Logo} alt="Logo"/></div>
    <div className='flex items-center'>
        <ul className='flex mx-2'>
            {NavBarItems.map((item) => {
                return (
                    <NavListItem key={item.name} item={item.name}/>
                );
            })}
        </ul>
        <button className='rounded-full border border-blue-500 p-2'>Sign Up</button>
    </div>
   </header>
  )
}

export default Header
